import React from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import GetAppIcon from '@material-ui/icons/GetApp';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import { dataMateria } from '../../../home';
import {useStyles} from './dialogos_principal'
import  jsPDF  from  ' jspdf '
 import' jspdf-autotable '

export default function ComposedTextField() {
 
  const pdfAsistencia =()=>{
    const pdf = new jsPDF()
    pdf.text(20,20,"Mostrando una Tabla con JsPDF y el Plugin AutoTable");
    
    var columns = ["Id", "Nombre", "Email", "Pais"];
    var data = [
    [1, "Hola", "hola@gmail.com", "Mexico"],
    [2, "Hello", "hello@gmail.com", "Estados Unidos"],
    [3, "Otro", "otro@gmail.com", "Otro"] ];
    
    pdf.autoTable(columns,data,
    { margin:{ top: 25 }}
    );
    
    pdf.save('mipdf.pdf');
  }

  const classes = useStyles();
  return (
    <React.Fragment>
    <CssBaseline />
    <Container maxWidth="sm">
    <div className={classes.avatar}>
    <Avatar src="/broken-image.jpg" />
    </div>
      <Typography variant="button" display="block" gutterBottom>
        Nombre: {dataMateria[0].nameDocente}
      </Typography>
      <Typography variant="button" display="block" gutterBottom>
        Clave: {dataMateria[0].clavePersonal}
      </Typography>
      <Typography variant="button" display="block" gutterBottom>
        Divicion: {dataMateria[0].nombreCorto}
      </Typography>
      <div className={classes.pdfss}>
      <Button 
       onClick={pdfAsistencia}
        variant="contained"
        color="default"
        startIcon={<GetAppIcon />}
      >
        Descargar lista de asistencia
      </Button>
      </div>
    </Container>
    
  </React.Fragment>
   
  
      

   
      
    
      
     
      
    
  );
}
